import React from 'react'

const Region = (props) => {

	const pokeList = props.rand.map((poke, index) => 
		<img
			key={poke.id}
			src={poke.front}
			className={`pokeImg${index}`}
			alt={poke.name}
			onClick={() => props.selectWildPoke(poke)}>
		</img>) 

	return(
		<div className='region' id={props.name}>
			{pokeList}
		</div>
	)	
}

export default Region;
